const addAccount = (data) => {
  return (dispatch) => {
    fetch("http://localhost:3000/api/v1/accounts", {
      method: "post",
      headers: {
        "Contect-Type": "application/json",
      },
      body: JSON.stringify({ "account": `${data}` }),
    });
  };
};
export default addAccount;
